import { useState } from "react";
import BlockContainer from "./BlockContainer";
import Header from "./Header";
import "./style.css";

function App() {
  const [blocks, setBlocks] = useState([
    {id: 1, date:"03/07/2004"},
    {id: 2, date:"03/07/2004"},
    {id: 3, date:"03/07/2004"},
    {id: 4, date:"03/07/2004"},
    {id: 5, date:"03/07/2004"},
    {id: 6, date:"03/07/2004"},
    {id: 7, date:"03/07/2004"},
    {id: 8, date:"03/07/2004"},
    {id: 9, date:"03/07/2004"},
  ]);
  return (
    <div className="App">
      <BlockContainer blocks={blocks}/>
    </div>
  );
}

export default App;
